window.bookSummaryJSON = "<p><b>New York Times best-selling author Stephanie Garber’s limitless imagination takes flight once more in the colorful, mesmerizing, and immersive sequel to the best-selling breakout audiobook debut </b><b><i>Caraval</i></b></p> <p>A heart to protect. A debt to repay. A game to win.</p> <p>After being swept up in the magical world of Caraval, Donatella Dragna has finally escaped her father and saved her sister, Scarlett, from a disastrous arranged marriage. The girls should be celebrating, but Tella isn’t yet free. She made a desperate bargain with a mysterious criminal, and what Tella owes him no one has ever been able to deliver: Caraval Master Legend’s true name.</p> <p>The only chance of uncovering Legend’s identity is to win Caraval, so Tella throws herself into the legendary competition once more - and into the path of the murderous heir to the throne, a doomed love story, and a web of secrets...including her sister's. Caraval has always demanded bravery, cunning, and sacrifice. But now the game is asking for more. If Tella can’t fulfill her bargain and deliver Legend’s name, she’ll lose everything she cares about - maybe even her life. But if she wins, Legend and Caraval will be destroyed forever.</p> <p>Welcome, welcome to Caraval...the games have only just begun.</p>"; 
